export default function Home(props) {
    const user = memoryUtil.user;
    if (!user || !user._id) return <Redirect to="/login" />
        
    return (





        <Layout>
     
      <Layout>
        
        <Sider className='sider' width="4rem" style={{backgroundColor:'transparent'}}  >
          <SideNav />
      </Sider>
        <Content style={{backgroundColor:'white'}}>Content</Content>
        <Footer>Footer</Footer>
      </Layout>
    </Layout>
    )

}
